import 'dart:convert';

String? findShelterno(String houseno) {
  final Map<String, dynamic> geoJson = json.decode(jsonString);
  final features = geoJson['features'] as List<dynamic>;

  for (var feature in features) {
    final properties = feature['properties'] as Map<String, dynamic>;
    if (properties['houseno'] == houseno) {
      return properties['shelterno'];
    }
  }
  return "Not Found"; // Return null if not found
}

String? findDistance(String houseno) {
  final Map<String, dynamic> geoJson = json.decode(jsonString);
  final features = geoJson['features'] as List<dynamic>;

  for (var feature in features) {
    final properties = feature['properties'] as Map<String, dynamic>;
    if (properties['houseno'] == houseno) {
      return properties['distance'];
    }
  }
  return "Not Found"; // Return null if not found
}

List<List<double>> findGeometryByhouseno(String houseno) {
  // Step 1: Parse the JSON string
  final jsonData = jsonDecode(jsonString);

  // Step 2: Iterate over features and find the matching shelterno
  for (var feature in jsonData['features']) {
    if (feature['properties']['houseno'] == houseno) {
      // Step 3: Extract the geometry (coordinates)
      return List<List<double>>.from(feature['geometry']['coordinates']
          .map((coord) => List<double>.from(coord)));
    }
  }

  return [];
}

String generateGoogleMapsPolylineUrl(List<List<double>> coordinates) {
  String path = coordinates.map((coord) => '${coord[0]},${coord[1]}').join('|');
  return path;
}

